import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="header">
      <div className="leftHeader">
        <button></button>
      </div>

      <div className="rightHeader">
        <input type="text" placeholder="" />
        <button></button>
      </div>
    </div>
  );
}

export default App;
